import React from 'react';

const FloatBanner = () => {
  return (
    <div className="float-banner">
      <div className="float-banner-content">
        <div className="banner-item">
          <a href="/promotions">
            <img 
              src="https://img.s628b.com/upload/announcement/image_293240.jpg" 
              alt="Special Offer" 
              loading="lazy"
            />
          </a>
        </div>
      </div>
    </div>
  );
};

export default FloatBanner;
